@notice Calculate the capacity based on an index.
@dev This function computes the capacity dynamically based on the provided index.
@param index The index value used for capacity calculation.
@return capacity The calculated capacity.

@notice Updates the ClusterRegistry contract.
@dev Only callable by the owner. Cannot be set if it's already been set before.
@param _clusterRegistry The new ClusterRegistry contract address.

@notice Updates the LiquidityRamp contract.
@dev Only callable by the owner. Cannot be set if it's already been set before.
@param _liquidityRamp The new LiquidityRamp contract address.

@notice Updates the SwapManager contract.
@dev Only callable by the owner. Cannot be set if it's already been set before.
@param _swapManager The new SwapManager contract address.

@notice Retrieves the maximum deposit limit for a token in a single transaction.
@dev The function considers the voting power of the token if applicable.
     The limit is clamped based on a precision constant.
@param token The ERC20 token for which the deposit limit is queried.
@return limit The maximum amount that can be deposited in a single transaction.

@notice Fetches the withdrawal limit for a given token in a single transaction.
@dev This function takes into account the voting power of the token, if applicable.
@param token The ERC20 token for which the limit is queried.
@return limit The maximum amount that can be withdrawn in a single transaction.

@notice Distributes tokens to clusters.
@dev Only callable by addresses with the LiquidityHandler role.
@param poolIdx The index of the originating pool.
@param token The ERC20 token to be distributed.
@param amount The amount of tokens to distribute.

@notice Enables the withdrawal of tokens from a liquidity pool to a destination address.
@dev This function allows only authorized liquidity handlers to withdraw tokens.
It implements a loop to navigate through clusters, restricted by a TRANSACTION_CLUSTER_LIMIT.
@param poolIdx The index of the liquidity pool from which to withdraw.
@param token The ERC20 token to be withdrawn.
@param to The destination address for the withdrawn tokens.
@param amount The amount of tokens to be withdrawn.

@notice Retrieves the token balance of a specified liquidity pool at a given block number.
@dev Uses a binary search algorithm on an array of historical balance checkpoints.
@param poolIdx The index of the liquidity pool in question.
@param token The ERC20 token for which the balance is being queried.
@param blockNumber The block number at which the balance is being queried.
@return The token balance of the liquidity pool at the specified block number.

@notice Safely converts a uint256 to a uint32, reverting if the conversion is not possible.
@dev Throws an exception if the input number is greater than or equal to 2^32.
@param n The uint256 number to be converted.
@return A uint32 number that is equivalent to the input number.
